        setToggleMenu(toggleMenu);
    }

    return (

        <nav>
            {toggleMenu && (
            <ul className='liste'>
                <li className='items'>Accueil</li>
                <li className='items' >Services</li>
                <li className='items' >FFFFF</li>
            </ul>
            ) }
            <button onClick={toggleNavSmallScreen} className='btn'>btn Menu</button>

        </nav>

    )
}
